import { Container, Typography } from "@mui/material";
import { Box } from "@mui/system";
import { useEffect, useState } from "react";
import { useNavigate } from "react-router";
import CryptoBlock from "../../myComponents/crypto-block/CryptoBlock";
import NavBar from "../../myComponents/navbar/Navbar";
import "./style.css"

export default function CryptoPage() {

  const cryptoData = [
    {
      "id": "1",
      "name": "Bitcoin",
      "image": "https://cryptologos.cc/logos/bitcoin-btc-logo.svg?v=018"
    },
    {
      "id": "2",
      "name": "Ethereum",
      "image": "https://cryptologos.cc/logos/ethereum-eth-logo.png?v=018"
    },
    {
      "id": "3",
      "name": "Binance",
      "image": "https://cryptologos.cc/logos/binance-coin-bnb-logo.png?v=018"
    },
    {
      "id": "4",
      "name": "Bitchgffoin",
      "image": "https://cryptologos.cc/logos/bitcoin-btc-logo.svg?v=018"
    },
    {
      "id": "5",
      "name": "e4rt",
      "image": "https://cryptologos.cc/logos/bitcoin-btc-logo.svg?v=018"
    },
    {
      "id": "6",
      "name": "34",
      "image": "https://cryptologos.cc/logos/bitcoin-btc-logo.svg?v=018"
    },
    {
      "id": "7",
      "name": "34",
      "image": "https://cryptologos.cc/logos/bitcoin-btc-logo.svg?v=018"
    },
    {
      "id": "8",
      "name": "ff",
      "image": "https://cryptologos.cc/logos/bitcoin-btc-logo.svg?v=018"
    },
    {
      "id": "9",
      "name": "ddd",
      "image": "https://cryptologos.cc/logos/bitcoin-btc-logo.svg?v=018"
    },
    {
      "id": "10",
      "name": "Bitcoin",
      "image": "https://cryptologos.cc/logos/bitcoin-btc-logo.svg?v=018"
    },
  ];

  const navigate = useNavigate();
  const [data, setData] = useState([]);
  const [value, setValue] = useState('');
  const [name, setName] = useState('');

  function getValue(value, name) {
    setValue(value);
    setName(name);
  }

  function handleClose(e) {
    // e.preventDefault();
    let mydata = {
      value,
      name,
    }
    setData([...data, mydata]);
    setName('');
    setValue('');
  }

  // function handleBuy(){
  //   localStorage.setItem('data', JSON.stringify(data));
  // }

  useEffect(() => {
    localStorage.setItem('data', JSON.stringify(data))
  }, [data])

  return (
    <>
      <Container>
        <NavBar />
        <Box className="header" sx={{ padding: "50px 60px", mb: "10px", borderRadius: "15px" }}>
          <Typography variant="small">
            Crypto Coins
          </Typography>
        </Box>
        <Box>
          {
            cryptoData.map((item) => (

              <>
              <CryptoBlock
                value={getValue}
                // handleBuy={handleBuy}
                handleClose={handleClose}
                item={item}
              />
              </>
            ))
          }
        </Box>
      </Container>
    </>
  )
}
